import React from 'react';
import {Link} from 'react-router-dom';
import './cajalocalidades.css';
import Usaquen from "../../Utils/Img/Cajas/sumapaz.png";
import Chapinero from "../../Utils/Img/Cajas/ciudad-bolivar.png";
import Santafe from "../../Utils/Img/Cajas/candelaria.png";
import Sancristobal from "../../Utils/Img/Cajas/antonio.png";
import Usme from "../../Utils/Img/Cajas/teusaquillo.png";
import Tunjuelito from "../../Utils/Img/Cajas/tunjuelito.png";
import Bosa from "../../Utils/Img/Cajas/bosa.png";
import Kenedi from "../../Utils/Img/Cajas/kennedy.png";
import Fontibon from "../../Utils/Img/Cajas/fontibón.png";
import Engativa from "../../Utils/Img/Cajas/ciudad-bolivar.png";
import Suba from "../../Utils/Img/Cajas/candelaria.png";
import Barriosunidos from "../../Utils/Img/Cajas/usme.png";
import Teusaquillo from "../../Utils/Img/Cajas/teusaquillo.png";
import Martires from "../../Utils/Img/Cajas/martires.png";
import Antonionariño from "../../Utils/Img/Cajas/antonio.png";
import Puentearanda from "../../Utils/Img/Cajas/usme.png";
import Candelaria from "../../Utils/Img/Cajas/candelaria.png";
import Uribe from "../../Utils/Img/Cajas/rafael.png";
import Cbolivar from "../../Utils/Img/Cajas/ciudad-bolivar.png";
import Otro from "../../Utils/Img/Cajas/sumapaz.png";

import Usaquen1 from "../../Utils/Img/Localidad/Usaquen.jpg";
import Chapinero1 from "../../Utils/Img/Localidad/chapinero.jpeg";
import Santafe1 from "../../Utils/Img/Localidad/santafe.jpg";
import Sancristobal1 from "../../Utils/Img/Localidad/san_cristobal.png";
import Usme1 from "../../Utils/Img/Localidad/usme.jpg";
import Tunjuelito1 from "../../Utils/Img/Localidad/tunjuelito.jpg";
import Bosa1 from "../../Utils/Img/Localidad/bosa.jpg";
import Kenedi1 from "../../Utils/Img/Localidad/kennedy.jpg";
import Fontibon1 from "../../Utils/Img/Localidad/fontibón.jpeg";
import Engativa1 from "../../Utils/Img/Localidad/engativá.jpeg";
import Suba1 from "../../Utils/Img/Localidad/suba.jpg";
import Barriosunidos1 from "../../Utils/Img/Localidad/barrios-unido.jpg";
import Teusaquillo1 from "../../Utils/Img/Localidad/teusaquillo.jpg";
import Martires1 from "../../Utils/Img/Localidad/los-martires.jpg";
import Antonionariño1 from "../../Utils/Img/Localidad/AntonioNariño.jpg";
import Puentearanda1 from "../../Utils/Img/Localidad/Puente-aranda.jpg";
import Candelaria1 from "../../Utils/Img/Localidad/candelaria.jpg";
import Uribe1 from "../../Utils/Img/Localidad/RafaelU.jpg";
import Cbolivar1 from "../../Utils/Img/Localidad/ciudad-bolivar.jpg";
import Otro1 from "../../Utils/Img/Localidad/Sumapaz.jpg";



function Cajalocalidades() {
  return (
    <div className="cajalocalidad">
      <div className="usuario">

      <div className="containerbotonlocalidad">     
           <p id="frase">
      <div className="Botoneslocalidad">
      <Link exact to="/Count">
                        <button>Aforo</button>
                        </Link>
               </div>
      </p> 
      <p id="frase">
      <div className="Botoneslocalidad">
      <Link exact to="/genero">
                        <button>Género</button>
                        </Link>
               </div>
      </p> 
      <p id="frase">
      <div className="Botoneslocalidad">
      <Link exact to="/localidad">
                        <button>Localidad</button>
                        </Link>
               </div>
      </p> 
       <p id="frase">
      <div className="Botoneslocalidad">
      <Link exact to="/edad">
                        <button>Edad</button>
                        </Link>
               </div>
      </p> 

       </div> 


      <div className="Contenidolocalidad">

      <div className="filacomo">
		<div className="cajacomo">
       <img id="imgloc3" src={Suba} alt="Esta es la img" /><h5>Suba</h5>
       </div>

    <div className="cajacomo"> 
    <img id="imgloc2" src={Barriosunidos} alt="Esta es la img" /><h5>B.Unidos</h5>
   </div>

    <div className="cajacomo"> 
    <img id="imgloc" src={Teusaquillo} alt="Esta es la img" /><h5>Teusaquillo</h5>
    </div>

    <div className="cajacomo">
    <img id="imgloc2" src={Martires} alt="Esta es la img" /><h5>Los Martirez</h5>
    </div> 

    <div className="cajacomo">  
    <img id="imgloc3" src={Antonionariño} alt="Esta es la img" /><h5>A.Nariño</h5>
    </div>



        </div>
        <div className="filacomo">
		<div className="cajacomo"> 
    <img id="imgloc2" src={Puentearanda} alt="Esta es la img" /><h5>P.Aranda</h5>
   </div>

    <div className="cajacomo"> 
    <img id="imgloc3" src={Candelaria} alt="Esta es la img" /><h5>La Candelaria</h5>
   </div>

    <div className="cajacomo"> 
    <img id="imgloc" src={Uribe} alt="Esta es la img" /><h5>Rafael Uribe</h5>
   </div>

    <div className="cajacomo">
    <img id="imgloc" src={Cbolivar} alt="Esta es la img" /><h5>C.Bolivar</h5>
  </div>

    <div className="cajacomo">
    <img id="imgloc3" src={Otro} alt="Esta es la img" /><h5>Otros</h5>
    </div> 



        </div>

      </div>	






</div>
</div> 


  );
}

export default Cajalocalidades;
